import React from 'react';
import './App.css';
import io from "socket.io-client";

// connect from socket with back one
const socket = io.connect("http://localhost:3002");

function App() {

  const sendMessage = () =>{
    socket.emet();
  }

  return (
    <div className="App">
      <h1>Hello world</h1>
      <input placeholder='Message'/>
      <button onClick={sendMessage}>Send</button>
    </div>
  );
}

export default App;
